import React, { useEffect,useState } from 'react';
import Unity, { UnityContext } from 'react-unity-webgl';
import UserStore from '../../stores/User';
import enums from '../../utils/enums';

import {
    Container,
    Stack,
    Typography,
} from '@mui/material';

const unityContext = new UnityContext({
    loaderUrl: "10-E.loader.js",
    dataUrl: "10-E.data",
    frameworkUrl: "10-E.framework.js",
    codeUrl: "10-E.wasm",
});

const RoomBuilder  = () => {
    
    const store = new UserStore();

    const [userName , setUsername ] = useState('');
    const [unityIsAwake, setUnityIsAwake] = useState(false);
    const [ savedObjs, setSavedObjs] = useState<string[]>([]);

    useEffect(function(){
        if(unityIsAwake){
            unityContext.send("GameManager", "ReceiveDataFromFrontEnd", savedObjs.join(','));
        }
    }, [savedObjs, unityIsAwake]);

    // From Front-end --> Unity
    useEffect(() => {
        const GetCookies = (store: UserStore) => {
            const userCookies = document.cookie;
            if(userCookies !== undefined ){
                const splitCookies = userCookies.split('; ');
                if(splitCookies !== undefined){

                    const idCookie = splitCookies.find((row)=>{
                        return (row.includes('user_id='));
                    });

                    if(idCookie !== undefined ){
                        store.setUserId(idCookie.split(('='))[1]);
                    }

                    const uniqueCookie = splitCookies.find((row)=>{
                        return (row.includes('unique_id='));
                    });
                    if(uniqueCookie !== undefined ){
                        store.setUserUniqueId(uniqueCookie.split(('='))[1]);
                    }

                    const username = splitCookies.find((row)=>{
                        return (row.includes('username='));
                    });
                    if(username !== undefined ){
                        store.setUserName(username.split(('='))[1]);
                    }
                }
            }
        };
        GetCookies(store);
        const fetchObjs = async () => {
            try {
                const savedArt = await store.getUserSavedObjs();
                setSavedObjs(savedArt);
            } catch (error) {
                console.log("error", error);
            }
        };
        fetchObjs();
        setUsername(store.userName ?? '')
    }, []);

    // From Unity --> Front-end
    useEffect( function () {
        unityContext.on("SendScreenshot", (imgData)=>{
            console.log("Send Screenshot fired from Unity: ");

            const bothTypesOfImgs = imgData.split('**IMG_TYPE_SEPARATOR**');
            const allWallImgs = bothTypesOfImgs[0].split('**BREAK**');
            const allOverheadImgs = bothTypesOfImgs[1].split('**BREAK**');

            store.UpdateAllUserImages(allWallImgs, allOverheadImgs).then((data: any)=>{
                console.log("in then");
                console.log(data);
            });
        });
    }, []);

    useEffect(function () {
        unityContext.on("UnityHasAwoken", (hasAwoken)=>{
            if(hasAwoken === "AWAKE"){
                setUnityIsAwake(true);
            }
        });
    }, []);

    //Used for showing Unity Debug Logs
    useEffect(function () {
        unityContext.on("debug", function (message) {
            console.log(message);
        });
    }, []);




    const Test = () => {

        var testImg = [
            'data:image/jpeg;base64,',
            "data:image/png;base64,"
        ];
        store.UpdateUserWallImages(testImg).then((data)=>{
            console.log("in then");
        });
    };



    return (
        <Container sx={{paddingTop: "2%", paddingBottom: "2%"}}>
            <Stack
                spacing={4}
                direction={"column"}
                sx={{alignItems: 'center'}}
            >
                <Typography variant={"h4"} component={"h4"}>
                    {`Username: ${userName}`}
                </Typography>

                    <Unity
                        unityContext={unityContext}
                        style={{
                            width: 320,
                            height: 480,
                            border: "2px solid black",
                            background: "grey",
                        }}
                    />

            </Stack>
        </Container>
    );
};


export default RoomBuilder;
